const Statistics = (props) => {
	const {allFeedback, good, bad, neutral} = props;
	return (
		<p>
			all {allFeedback.length} <br />
			average {parseFloat((good-bad)/(allFeedback.length))} <br />
			positive {parseFloat((good)/(allFeedback.length) * 100)} %
		</p>
	)
}

export default Statistics;
